import React from 'react';
import { Box, Grid, Paper, Typography } from '@mui/material';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';
import { Bar } from 'react-chartjs-2';
import { initialUsers } from './UserList';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

const Dashboard: React.FC = () => {
  // Process data for Roles by Location
  const rolesByLocation = initialUsers.reduce((acc: Record<string, Record<string, number>>, user) => {
    if (user.location && user.jobRole) {
      if (!acc[user.location]) {
        acc[user.location] = {};
      }
      acc[user.location][user.jobRole] = (acc[user.location][user.jobRole] || 0) + 1;
    }
    return acc;
  }, {});

  // Process data for Roles by Team
  const rolesByTeam = initialUsers.reduce((acc: Record<string, Record<string, number>>, user) => {
    if (user.jobRole) {
      user.memberOf.forEach(team => {
        if (!acc[team]) {
          acc[team] = {};
        }
        acc[team][user.jobRole] = (acc[team][user.jobRole] || 0) + 1;
      });
    }
    return acc;
  }, {});

  // Process data for Teams by Location
  const teamsByLocation = initialUsers.reduce((acc: Record<string, Record<string, number>>, user) => {
    if (user.location) {
      if (!acc[user.location]) {
        acc[user.location] = {};
      }
      user.memberOf.forEach(team => {
        acc[user.location][team] = (acc[user.location][team] || 0) + 1;
      });
    }
    return acc;
  }, {});

  // Generate random colors
  const generateColors = (count: number) => {
    return Array.from({ length: count }, (_, i) => 
      `hsl(${(i * 360) / count}, 70%, 50%)`
    );
  };

  // Chart configurations
  const chartOptions = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        position: 'top' as const,
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        ticks: {
          stepSize: 1
        }
      }
    }
  };

  // Roles by Location Chart Data
  const rolesByLocationData = {
    labels: Object.keys(rolesByLocation),
    datasets: Object.keys(rolesByLocation).map((location, index) => ({
      label: location,
      data: Object.values(rolesByLocation[location]),
      backgroundColor: generateColors(Object.keys(rolesByLocation).length)[index],
    }))
  };

  // Roles by Team Chart Data
  const rolesByTeamData = {
    labels: Object.keys(rolesByTeam),
    datasets: Object.keys(rolesByTeam).map((team, index) => ({
      label: team,
      data: Object.values(rolesByTeam[team]),
      backgroundColor: generateColors(Object.keys(rolesByTeam).length)[index],
    }))
  };

  // Teams by Location Chart Data
  const teamsByLocationData = {
    labels: Object.keys(teamsByLocation),
    datasets: Object.keys(teamsByLocation).map((location, index) => ({
      label: location,
      data: Object.values(teamsByLocation[location]),
      backgroundColor: generateColors(Object.keys(teamsByLocation).length)[index],
    }))
  };

  return (
    <Box sx={{ flexGrow: 1, p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Analytics Dashboard
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2, height: 400 }}>
            <Typography variant="h6" gutterBottom>
              Roles by Location
            </Typography>
            <Box sx={{ height: 320 }}>
              <Bar data={rolesByLocationData} options={chartOptions} />
            </Box>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2, height: 400 }}>
            <Typography variant="h6" gutterBottom>
              Roles by Team
            </Typography>
            <Box sx={{ height: 320 }}>
              <Bar data={rolesByTeamData} options={chartOptions} />
            </Box>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2, height: 400 }}>
            <Typography variant="h6" gutterBottom>
              Teams by Location
            </Typography>
            <Box sx={{ height: 320 }}>
              <Bar data={teamsByLocationData} options={chartOptions} />
            </Box>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Dashboard;
